import React from "react";
import "./Footer.css";
import logo from '../assets/icons/niji.svg';
import { Link } from 'react-router-dom';

function Footer() {
    return (
        <footer>
            <div className="logo-container">
                <img src={logo} alt="Logo" />
                <h4 className="logo">
            <Link to="/almost-done">
                Almost Done
                </Link>
            </h4>
            </div>
        </footer>
        )
}

export default Footer;
